import VotingItem from "./VotingItem"

function VotingList({candidates}) {
    candidates = Array.from(candidates )
    return (
      
      <div> 
      {candidates .map((candidate) => (
          <VotingItem candidate  = {candidate} key = {candidate.id}/>
        ))}
      </div>
    )
  }

export default VotingList
